6865_6923418710527114891_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=NSqOzRX3hM8AX8AtPX8&_nc_tp=18&oh=a5803ac57da6e3cca823975aac7ca37a&oe=5F7B409A";}i:86;a:1:{s:4:"type";s:5:"image";}i:87;a:1:{s:8:"owner_id";i:264581212;}i:88;a:1:{s:14:"owner_username";s:0:"";}i:89;a:1:{s:14:"owner_fullname";s:0:"";}i:90;a:1:{s:9:"owner_pic";s:0:"";}i:91;a:1:{s:2:"id";s:19:"2390894284808880531";}i:92;a:1:{s:10:"short_code";s:11:"CEuKa89i4GT";}i:93;a:1:{s:12:"created_time";i:1599236830;}i:94;a:1:{s:7:"caption";s:1979:"» Es geht nicht um die Bezeichnung "Beste Freundin". Es geht nicht darum, dass ich Sie auf Instagram als meine beste Freundin taggen kann. Es geht nicht darum, dass ich Halt bei einem anderen Menschen suche und dabei jemanden gefunden habe, der mit mir gemeinsam durch diese Phase(n) geht und danach wieder ersetzbar wird. Es geht nicht darum, dass ich aller Welt zeigen kann, in was für einer tollen Freundschaft ich mich befinde, es geht weder um Neiderzeugung noch um Likes. Es geht auch nicht darum, dass Sie im Allgemeinen der beste Mensch ist. Es geht darum, dass Sie es für mich ist. Sie ist meine Definition von Brüderlichkeit, Loyalität und Vertrauen. Sie ist der Mensch, den ich bis ans Ende nehmen möchte, der Mensch, der mit mir durch so viele Zeiten gegangen ist, der Mensch, der bei mir geblieben ist, egal wie unkorrekt ich mich manchmal verhalten habe. Solch eine Freundschaft wird sich ihren Weg immer suchen und sich dort wiederfinden, wo die Verbindungen anknüpfen, wo die Erinnerungen kollidieren und die Gefühle für den jeweils Anderen überschlagen. Es geht mir nicht um Abhängigkeit, nein, wir sind frei, aber nicht alleine, sondern gemeinsam. Wir sind frei in unserer Bindung, weil wir uns vertrauen können, nicht nur blind, sondern auch taubstumm. Alles auf dem Planeten Erde ist vergänglich, richtig, trotzdem werde ich unsere Bindung hüten und im Falle des Falles alles dafür geben, dass sie bestehen bleibt!
Ich bin so dankbar für das alles.
Ich liebe dich. ❤️
